import Navigation from '../Navigation/Navigation';
import Showcase from '../Showcase/Showcase';

class Main extends Component {
    render() {
        return (
            <div className="Main">
                <Navigation />
                <Showcase />
                <About />
            </div>
        );
    }
}

export default Main;
